Levando o título do primeiro single ao pé da letra, o tempo acelerou total e hoje, esse projeto audacioso completa 10 anos. No dia 4 de setembro de 2010, Ivete Sangalo se consagrava "O Brasil no Mundo", sendo a primeira e única brasileira a se apresentar e gravar um DVD na arena, considerada um templo da música, Madison Square Garden, em Nova York.
.
Com uma capacidade em torno de 15 mil pessoas, os ingressos esgotaram em questão de horas e o rostinho da baiana estava espalhada por toda Big Apple. A crítica e imprensa americana caíram de amores pela cantora, rendendo matérias no "The New York Times" e "New York Post".
.
Para o show, Sangalo apresentou seus maiores sucessos e algumas inéditas, divididas em 5 atos e contou com as participações de: Seu Jorge, Nelly Furtado, Juanes e Diego Torres. 
.
O projeto chegou às lojas em dezembro nos fornatos CD, DVD e Blu-ray, atingindo a marca dos milhões em vendas e recebendo inúmeros prêmios e indicações, inclusive Grammy Latino.
